import React from "react";

const AboutUsNavbar = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return (
    <div style={mystyle}>
      <h1>About Us</h1>
      <p>Learn more about us here.</p>
    </div>
  );
};

export default AboutUsNavbar;
